import {Container, Card} from 'react-bootstrap'

const ProfilePreview = () => {
    return (
        <Container>
            <div style={{color: "grey", "text-align": "center"}}>
                <h1>Profile Page</h1>
                
            </div>
        </Container>
    )
}

export default ProfilePreview
